import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on "Your Profile" link (first occurrence)
    await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });
    const profileLinks = await page.$$('a:text("Your Profile")');
    if (profileLinks.length === 0) throw new Error('No "Your Profile" link found');
    await profileLinks[0].click();

    // Wait for profile page to load (wait for .profile-header)
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile info
    const extractedData = await page.evaluate(() => {
      const profileHeader = document.querySelector('.profile-header');
      if (!profileHeader) return {};

      const img = profileHeader.querySelector('.profile-image');
      const fullName = profileHeader.querySelector('.profile-info h2')?.innerText?.trim() || '';
      const username = profileHeader.querySelector('.username')?.innerText?.replace(/^@/, '').trim() || '';
      const bio = profileHeader.querySelector('.bio')?.innerText?.trim() || '';

      // Stats
      const statEls = profileHeader.querySelectorAll('.stat');
      const stats = {};
      statEls.forEach(stat => {
        const label = stat.querySelector('.stat-label')?.innerText?.trim().toLowerCase();
        const number = stat.querySelector('.stat-number')?.innerText?.trim();
        if (label && number) stats[label] = number;
      });

      return {
        fullName,
        username,
        bio,
        profileImage: img?.src || '',
        stats
      };
    });

    // Take screenshot of profile stats area
    const profileHeaderHandle = await page.$('.profile-header');
    if (profileHeaderHandle) {
      await profileHeaderHandle.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_header.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_profile_header.png'));
    }

    // Extract Jun's recent reviews (titles and ratings)
    await page.waitForSelector('.reviews-list .review-item', { timeout: 5000 });
    const reviews = await page.evaluate(() => {
      const reviewEls = document.querySelectorAll('.reviews-list .review-item');
      return Array.from(reviewEls).map(el => {
        const productTitle = el.querySelector('.review-product-title')?.innerText?.trim() || '';
        const reviewTitle = el.querySelector('.review-title')?.innerText?.replace(/"/g, '').trim() || '';
        const ratingStars = el.querySelector('.stars')?.innerText || '';
        const rating = ratingStars ? (ratingStars.match(/★/g) || []).length + (ratingStars.includes('☆') ? 0.5 : 0) : null;
        const reviewDate = el.querySelector('.review-date')?.innerText?.trim() || '';
        return { productTitle, reviewTitle, rating, reviewDate };
      });
    });

    extractedData.recentReviews = reviews;

    // Extract Jun's products (titles and prices)
    await page.waitForSelector('.profile-sections .section .products-grid .product-card', { timeout: 5000 });
    const products = await page.evaluate(() => {
      const productEls = document.querySelectorAll('.profile-sections .section .products-grid .product-card');
      return Array.from(productEls).map(el => {
        const title = el.querySelector('.product-title')?.innerText?.trim() || '';
        const priceText = el.querySelector('.product-price')?.innerText?.trim() || '';
        const priceMatch = priceText.match(/\$([0-9.,]+)/);
        const price = priceMatch ? priceMatch[1] : '';
        return { title, price };
      });
    });

    extractedData.productsByJun = products;

    return {
      success: true,
      action: "Harvested user profile information including name, username, bio, stats, recent reviews, and Jun's products",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
